namespace AstoriaUnitTests.TDD.Tests.Client
{
    using System;
    using System.Collections.Generic;
    using System.Linq;
    using FluentAssertions;
    using Microsoft.OData.Client;
    using global::DelayQueryTests.ExchangePlus;
    using Xunit;

    public class DelayQueryTests
    {
        [Fact]
        public void DelayQueryUrlTest()
        {
            var context = new EntityContainerPlus(new Uri("http://serviceroot/odata"));

            var singletonQuery = context.MePlus;
            singletonQuery.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me");

            var entitySetQuery = context.UsersPlus;
            entitySetQuery.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Users");

            var singleNavigation = context.MePlus.InboxPlus;
            singleNavigation.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox");

            var singleNavigationWithKey = context.MePlus.FoldersPlus.ByKey(new Dictionary<string, object>() { { "id", "1" } }).MessagesPlus;
            singleNavigationWithKey.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Folders('1')/Messages");

            var singleNavigationTypeCast = context.MePlus.CastToSpecialUserPlus().InboxPlus;
            singleNavigationTypeCast.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Exchange.SpecialUser/Inbox");

            var function1 = context.MePlus.FoldersPlus.ByKey(new Dictionary<string, object>() { { "id", "1" } }).GetMessagesPlus(10);
            function1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Folders('1')/Exchange.GetMessages(n=10)");

            var collectionNavigation = context.MePlus.InboxPlus.MessagesPlus;
            collectionNavigation.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages");

            var select1 = context.MePlus.InboxPlus.Select(f => f.ClassNamePlus);
            select1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/ClassName");

            var select2 = context.MePlus.InboxPlus.MessagesPlus.Where(m => m.IdPlus == "1").Select(m => m.FromPlus) as DataServiceQuery;
            select2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages('1')/From");

            var select3 = context.MePlus.FoldersPlus.ByKey(new Dictionary<string, object>() { { "id", "1" } }).Select(m => m.ClassNamePlus);
            select3.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Folders('1')/ClassName");

            var projection1 = context.MePlus.InboxPlus.MessagesPlus.Select(msg => new MessagePlus() { SubjectPlus = msg.SubjectPlus, FromPlus = msg.FromPlus, DateTimeReceivedPlus = msg.DateTimeReceivedPlus }) as DataServiceQuery;
            projection1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages?$select=Subject,From,DateTimeReceived");

            var projection2 = context.MePlus.InboxPlus.Select(f => new FolderPlus() { DisplayNamePlus = f.DisplayNamePlus, MessagesPlus = f.MessagesPlus });
            projection2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox?$expand=Messages&$select=DisplayName");

            var expand = context.MePlus.Expand(user => user.InboxPlus.MessagesPlus).Expand(user => user.SentItemsPlus.MessagesPlus);
            expand.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me?$expand=Inbox($expand=Messages),SentItems($expand=Messages)");

            var orderbyTake = context.MePlus.InboxPlus.MessagesPlus.OrderByDescending(msg => msg.DateTimeReceivedPlus).Take(3) as DataServiceQuery;
            orderbyTake.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages?$orderby=DateTimeReceived desc&$top=3");

            var filter1 = context.MePlus.InboxPlus.MessagesPlus.Where(msg => msg.DateTimeReceivedPlus > new DateTimeOffset(new DateTime(2014, 4, 2), new TimeSpan(-7, 0, 0)) && msg.ImportancePlus == ImportancePlus.HighPlus) as DataServiceQuery;
            filter1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages?$filter=DateTimeReceived gt " + Uri.EscapeDataString("2014-04-02T00:00:00-07:00") + " and Importance eq Exchange.Importance'High'");

            var filter2 = context.MePlus.InboxPlus.MessagesPlus.Where(msg => msg.DateTimeReceivedPlus > new DateTimeOffset(new DateTime(2014, 4, 2), new TimeSpan(-7, 0, 0))).Where(msg => msg.ImportancePlus == ImportancePlus.HighPlus) as DataServiceQuery;
            filter2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages?$filter=DateTimeReceived gt " + Uri.EscapeDataString("2014-04-02T00:00:00-07:00") + " and Importance eq Exchange.Importance'High'");

            var filter3 = context.MePlus.InboxPlus.MessagesPlus.OfLatestDaysPlus(10).Where(m => m.IdPlus == "1") as DataServiceQuery;
            filter3.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages/Exchange.OfLatestDays(days=10)('1')");

            var actionOnEntity1 = context.MePlus.InboxPlus.MessagesPlus.ByKey(new Dictionary<string, object>() { { "id", "1" } }).MovePlus("5");
            actionOnEntity1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages('1')/Exchange.Move");

            var actionOnEntity2 = context.MePlus.InboxPlus.MovePlus("5");
            actionOnEntity2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Exchange.Move");

            var actionOnEntitySet = context.MePlus.InboxPlus.MessagesPlus.MovePlus("5");
            actionOnEntitySet.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Messages/Exchange.Move");

            var functionOnEntity = context.MePlus.GetNewlyCreatedFolderPlus().MessagesPlus;
            functionOnEntity.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Exchange.GetNewlyCreatedFolder()/Messages");

            var functionOnEntitySet1 = context.MePlus.DraftsPlus.MessagesPlus.OfLatestDaysPlus(10).DeletePlus();
            functionOnEntitySet1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Drafts/Messages/Exchange.OfLatestDays(days=10)/Exchange.Delete");

            var functionOnEntitySet2 = context.MePlus.DraftsPlus.MessagesPlus.OfLatestDaysPlus(10).OfLatestDaysPlus(5);
            functionOnEntitySet2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Drafts/Messages/Exchange.OfLatestDays(days=10)/Exchange.OfLatestDays(days=5)");

            var functionOnEntitySet3 = context.MePlus.DraftsPlus.MessagesPlus.OfLatestDaysPlus(5).Where(m => m.ClassNamePlus == "TODO") as DataServiceQuery;
            functionOnEntitySet3.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Drafts/Messages/Exchange.OfLatestDays(days=5)?$filter=ClassName eq 'TODO'");

            var deriveSelect1 = context.MePlus.Select(c => (c as SpecialUserPlus).SpecialOrderPlus);
            deriveSelect1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Exchange.SpecialUser/SpecialOrder");

            var deriveSelect2 = context.UsersPlus.Where(u => u.IdPlus == "1").Select(c => (c as SpecialUserPlus).SpecialOrderPlus) as DataServiceQuery;
            deriveSelect2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Users('1')/Exchange.SpecialUser/SpecialOrder");

            var deriveProjection1 = context.MePlus.Select(m => new SpecialUserPlus() { SpecialOrderPlus = (m as SpecialUserPlus).SpecialOrderPlus });
            deriveProjection1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me?$select=Exchange.SpecialUser/SpecialOrder");

            var funtionAction = context.MePlus.InboxPlus.GetMessagesPlus(10).MovePlus("5");
            funtionAction.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Inbox/Exchange.GetMessages(n=10)/Exchange.Move");

            var unComposable = context.MePlus.MessagesPlus.ByKey(new Dictionary<string, object>() { { "id", "1" } }).GetUserPlus();
            unComposable.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Messages('1')/Exchange.GetUser()");

            var typecast = context.MePlus.CastToSpecialUserPlus().GetNewlyCreatedFolderPlus();
            typecast.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Exchange.SpecialUser/Exchange.GetNewlyCreatedFolder()");

            var functionInFilter1 = context.UsersPlus.Where(u => u.GetNewlyCreatedFolderPlus().GetValue().ClassNamePlus == "className") as DataServiceQuery;
            functionInFilter1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Users?$filter=$it/Exchange.GetNewlyCreatedFolder()/ClassName eq 'className'");

            var functionInFilter2 = context.UsersPlus.Where(u => u.GetNewlyCreatedFolderPlus().GetValue().GetMessagesPlus(10).Count() > 0) as DataServiceQuery;
            functionInFilter2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Users?$filter=$it/Exchange.GetNewlyCreatedFolder()/Exchange.GetMessages(n=10)/$count gt 0");

            var functionInFilter3 = context.UsersPlus.Where(u => u.InboxPlus.GetMessagesPlus(10).Count() > 0) as DataServiceQuery;
            functionInFilter3.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Users?$filter=Inbox/Exchange.GetMessages(n=10)/$count gt 0");

            var functionInfilterAsync1 = context.UsersPlus.Where(u => u.GetNewlyCreatedFolderPlus().GetValueAsync().Result.ClassNamePlus == "className") as DataServiceQuery;
            functionInfilterAsync1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Users?$filter=$it/Exchange.GetNewlyCreatedFolder()/ClassName eq 'className'");

            var functionInFilterAsync2 = context.UsersPlus.Where(u => u.GetNewlyCreatedFolderPlus().GetValueAsync().Result.GetMessagesPlus(10).Count() > 0) as DataServiceQuery;
            functionInFilterAsync2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Users?$filter=$it/Exchange.GetNewlyCreatedFolder()/Exchange.GetMessages(n=10)/$count gt 0");

            var byKey1 = context.MePlus.MessagesPlus.ByKey("1").GetSenderPlus();
            byKey1.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Messages('1')/Exchange.GetSender()");

            var byKey2 = context.MePlus.CalendarsPlus.ByKey("myCalendar", "1").EventsPlus;
            byKey2.RequestUri.OriginalString.Should().Be("http://serviceroot/odata/Me/Calendars(Name='myCalendar',ChangeKey='1')/Events");

            Action action = () => unComposable.GetNewlyCreatedFolderPlus();
            action.ShouldThrow<NotSupportedException>().WithMessage("The previous function is not composable.");

            action = () => unComposable.InboxPlus.GetValue();
            action.ShouldThrow<NotSupportedException>().WithMessage("The previous function is not composable.");
        }
    }
